import React, {Component} from 'react';
import Wrapper from './Wrapper/Wrapper';
import WeatherShow from './WeatherShow/WeatherShow'
import WeatherCity from './WeatherCity/WeatherCity'
import FetchOpenWeather from './FetchOpenWeather/FetchOpenWeather'
import axios from 'axios';

export default class App extends Component {

  componentDidMount() {
    axios.get('http://openweathermap.org/data/2.5/weather?q=%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0&appid=b6907d289e10d714a6e88b30761fae22')
  }

  render() {
    return (
      <Wrapper>
        <WeatherShow/>
        <WeatherCity/>
      </Wrapper>
    )
  }
}
